import React from 'react';
import {GlobalStyle} from './styles/global';
import Routes from './routers';
import GlobalState from './context/GlobalState';

export function App() {

    return (
        <BrowserRouter>
            <GlobalState>
            <Routes/>
            <GlobalStyle />
      </GlobalState>
        </BrowserRouter>
    );
}

export default App;
